(3, 1, 1, 'Regulamin', '', 'Regulamin', '18 Luty 2018', '<div class=\"row\">\n<div id=\"center_column\" class=\"center_column col-xs-12 col-sm-12\">\n<div class=\"rte\">\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 1</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Postanowienia wstpne<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Sklep internetowy fShop.pl, dostpny pod adresem internetowym www.fShop.pl ,</span><span lang=\"pl\" xml:lang=\"pl\">prowadzony jest przez ....., wpisan do Centralnej Ewidencji i Informacji o Dziaalnoci Gospodarczej (CEIDG) prowadzonej przez ministra waciwego ds. gospodarki, NIP ...... REGON</span><span lang=\"pl\" xml:lang=\"pl\">......</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">2. Niniejszy Regulamin skierowany jest zar贸wno do Konsument贸w, jak i do Przedsibiorc贸w korzystajcych ze Sklepu i okrela zasady korzystania ze Sklepu internetowego oraz zasady i tryb zawierania Um贸w Sprzeda偶y z Klientem na odlego za porednictwem Sklepu.</span></p>\n<p><br /><br /></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 2</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Definicje<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><b><span lang=\"pl\" xml:lang=\"pl\">Konsument</span></b><span lang=\"pl\" xml:lang=\"pl\">- osoba fizyczna zawierajca ze Sprzedawc umow w ramach Sklepu, kt贸rej przedmiot nie jest zwizany bezporednio z jej dziaalnoci gospodarcz lub zawodow.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><b><span lang=\"pl\" xml:lang=\"pl\">Sprzedawca</span></b><span lang=\"pl\" xml:lang=\"pl\">- osoba fizyczna prowadzca dziaalno gospodarcz pod firm ....... , wpisan do Centralnej Ewidencji i Informacji o Dziaalnoci Gospodarczej (CEIDG) prowadzonej przez ministra waciwego ds. gospodarki, NIP ........ , REGON ............</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.</span><b><span lang=\"pl\" xml:lang=\"pl\">Klient</span></b><span lang=\"pl\" xml:lang=\"pl\">- ka偶dy podmiot dokonujcy zakup贸w za porednictwem Sklepu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><b><span lang=\"pl\" xml:lang=\"pl\">Przedsibiorca</span></b><span lang=\"pl\" xml:lang=\"pl\">- osoba fizyczna, osoba prawna i jednostka organizacyjna niebdca osob prawn, kt贸rej odrbna ustawa przyznaje zdolno prawn, wykonujca we wasnym imieniu dziaalno gospodarcz, kt贸ra korzysta ze Sklepu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.</span><b><span lang=\"pl\" xml:lang=\"pl\">Sklep</span></b><span lang=\"pl\" xml:lang=\"pl\">- sklep internetowy prowadzony przez Sprzedawc pod adresem internetowym www.fShop.pl</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6.</span><b><span lang=\"pl\" xml:lang=\"pl\">Umowa zawarta na odlego</span></b><span lang=\"pl\" xml:lang=\"pl\">- umowa zawarta z Klientem w ramach zorganizowanego systemu zawierania um贸w na odlego (w ramach Sklepu), bez jednoczesnej fizycznej obecnoci stron, z wycznym wykorzystaniem jednego lub wikszej liczby rodk贸w porozumiewania si na odlego do chwili zawarcia umowy wcznie.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">7.</span><b><span lang=\"pl\" xml:lang=\"pl\">Regulamin</span></b><span lang=\"pl\" xml:lang=\"pl\">- niniejszy regulamin Sklepu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">8.</span><b><span lang=\"pl\" xml:lang=\"pl\">Zam贸wienie</span></b><span lang=\"pl\" xml:lang=\"pl\">- owiadczenie woli Klienta skadane za pomoc Formularza Zam贸wienia i zmierzajce bezporednio do zawarcia Umowy Sprzeda偶y Produktu lub Produkt贸w ze Sprzedawc.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">9.</span><b><span lang=\"pl\" xml:lang=\"pl\">Konto</span></b><span lang=\"pl\" xml:lang=\"pl\">- konto klienta w Sklepie, s w nim gromadzone s dane podane przez Klienta oraz informacje o zo偶onych przez niego Zam贸wieniach w Sklepie.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">10.</span><b><span lang=\"pl\" xml:lang=\"pl\">Formularz rejestracji</span></b><span lang=\"pl\" xml:lang=\"pl\">- formularz dostpny w Sklepie, umo偶liwiajcy utworzenie Konta.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">11.</span><b><span lang=\"pl\" xml:lang=\"pl\">Formularz zam贸wienia</span></b><span lang=\"pl\" xml:lang=\"pl\">- interaktywny formularz dostpny w Sklepie umo偶liwiajcy zo偶enie Zam贸wienia, w szczeg贸lnoci poprzez dodanie Produkt贸w do Koszyka oraz okrelenie warunk贸w Umowy Sprzeda偶y, w tym sposobu dostawy i patnoci.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">12.</span><b><span lang=\"pl\" xml:lang=\"pl\">Koszyk</span></b><span lang=\"pl\" xml:lang=\"pl\"> element oprogramowania Sklepu, w kt贸rym widoczne s wybrane przez Klienta Produkty do zakupu, a tak偶e istnieje mo偶liwo ustalenia i modyfikacji danych Zam贸wienia, w szczeg贸lnoci iloci produkt贸w.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">13.</span><b><span lang=\"pl\" xml:lang=\"pl\">Produkt</span></b><span lang=\"pl\" xml:lang=\"pl\">- dostpna w Sklepie rzecz ruchoma/usuga bdca przedmiotem Umowy Sprzeda偶y midzy Klientem a Sprzedawc.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">14.</span><b><span lang=\"pl\" xml:lang=\"pl\">Umowa Sprzeda偶y</span></b><span lang=\"pl\" xml:lang=\"pl\">- umowa sprzeda偶y Produktu zawierana albo zawarta midzy Klientem a Sprzedawc za porednictwem Sklepu internetowego. Przez Umow Sprzeda偶y rozumie si te偶 - stosowanie do cech Produktu - umow o wiadczenie usug i umow o dzieo.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 3</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Kontakt ze Sklepem<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Adres Sprzedawcy: ..........</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Adres e-mail Sprzedawcy:kontakt@fshop.pl</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.</span><span lang=\"pl\" xml:lang=\"pl\">Numer telefonu Sprzedawcy: ...........</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><span lang=\"pl\" xml:lang=\"pl\">Numer rachunku bankowego Sprzedawcy : ................</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.</span><span lang=\"pl\" xml:lang=\"pl\">Klient mo偶e porozumiewa si ze Sprzedawc za pomoc adres贸w i numer贸w telefon贸w podanych w niniejszym paragrafie.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6.</span><span lang=\"pl\" xml:lang=\"pl\">Klient mo偶e porozumie si telefonicznie ze Sprzedawc w godzinach 10:00 - 18:00<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 4</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Wymagania techniczne<br /><br /></span></b></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">Do korzystania ze Sklepu, w tym przegldania asortymentu Sklepu oraz skadania zam贸wie na Produkty, niezbdne s:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.</span><span lang=\"pl\" xml:lang=\"pl\">urzdzenie kocowe z dostpem do sieci Internet z przegldark internetow</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.</span><span lang=\"pl\" xml:lang=\"pl\">aktywne konto poczty elektronicznej (e-mail),</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.</span><span lang=\"pl\" xml:lang=\"pl\">wczona obsuga plik贸w cookies,</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\"></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 5</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Informacje og贸lne<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Sprzedawca w najszerszym dopuszczalnym przez prawo zakresie nie ponosi odpowiedzialnoci za zak贸cenia w tym przerwy w funkcjonowaniu Sklepu spowodowane si wy偶sz, niedozwolonym dziaaniem os贸b trzecich lub niekompatybilnoci Sklepu internetowego z infrastruktur techniczn Klienta.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Przegldanie asortymentu Sklepu nie wymaga zakadania Konta. Skadanie zam贸wie przez Klienta na Produkty znajdujce si w asortymencie Sklepu mo偶liwe jest albo po zao偶eniu Konta zgodnie z postanowieniami 搂 6 Regulaminu albo przez podanie niezbdnych danych osobowych i adresowych umo偶liwiajcych realizacj Zam贸wienia bez zakadania Konta.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.</span><span lang=\"pl\" xml:lang=\"pl\">Ceny podane w Sklepie s podane w polskich zotych.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><span lang=\"pl\" xml:lang=\"pl\">Na kocow (ostateczn) kwot do zapaty przez Klienta skada si cena netto za Produkt oraz podatek VAT 23%, o kt贸rej Klient jest informowany na stronach Sklepu w trakcie skadania Zam贸wienia, w tym tak偶e w chwili wyra偶enia woli zwizania si Umow Sprzeda偶y.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.</span><span lang=\"pl\" xml:lang=\"pl\">W przypadku Umowy obejmujcej prenumerat lub wiadczenie usug na czas nieoznaczony kocow (ostateczn) cen jest czna cena obejmujca wszystkie patnoci za okres rozliczeniowy.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6.</span><span lang=\"pl\" xml:lang=\"pl\">Gdy charakter przedmiotu Umowy nie pozwala, rozsdnie oceniajc, na wczeniejsze obliczenie wysokoci kocowej (ostatecznej) ceny, informacja o sposobie, w jaki cena bdzie obliczana, a tak偶e o opatach za transport, dostarczenie, usugi pocztowe oraz o innych kosztach, bdzie podana w Sklepie w opisie Produktu.</span></p>\n<p></p>\n<p class=\"Normalny1\" align=\"center\"><span lang=\"pl\" xml:lang=\"pl\"></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 6</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Zakadanie Konta w Sklepie<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Aby zao偶y Konto w Sklepie, nale偶y wypeni Formularz rejestracji. Niezbdne jest podanie nastpujcych danych: Imi i Nazwisko lub nazwa frmy , Adres zamieszkania lub adres siedziby firmy , adres e-mail, aktualny numer telefonu</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Zao偶enie Konta w Sklepie jest darmowe.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.</span><span lang=\"pl\" xml:lang=\"pl\">Logowanie si na Konto odbywa si poprzez podanie loginu i hasa ustanowionych w Formularzu rejestracji.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><span lang=\"pl\" xml:lang=\"pl\">Klient ma mo偶liwo w ka偶dej chwili, bez podania przyczyny i bez ponoszenia z tego tytuu jakichkolwiek opat usun Konto poprzez wysanie stosownego 偶dania do Sprzedawcy, w szczeg贸lnoci za porednictwem poczty elektronicznej lub pisemnie na adresy podane w 搂 3.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><span lang=\"pl\" xml:lang=\"pl\"></span><b><span lang=\"pl\" xml:lang=\"pl\">搂 7</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Zasady skadania Zam贸wienia<br /><br /></span></b></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">W celu zo偶enia Zam贸wienia nale偶y:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1. W</span><span lang=\"pl\" xml:lang=\"pl\">ybra Produkt bdcy przedmiotem Zam贸wienia, a nastpnie klikn przycisk Do koszyka</span><span lang=\"pl\" xml:lang=\"pl\">(lub r贸wnoznaczny)</span><span lang=\"pl\" xml:lang=\"pl\">;</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.Z</span><span lang=\"pl\" xml:lang=\"pl\">alogowa si lub skorzysta z mo偶liwoci zo偶enia Zam贸wienia bez rejestracji;</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.J</span><span lang=\"pl\" xml:lang=\"pl\">e偶eli wybrano mo偶liwo zo偶enia Zam贸wienia bez rejestracji - wypeni Formularz zam贸wienia poprzez wpisanie danych odbiorcy Zam贸wienia oraz adresu, na kt贸ry ma nastpi dostawa Produktu, wybra rodzaj przesyki (spos贸b dostarczenia Produktu), wpisa dane do faktury, jeli s inne ni偶 dane odbiorcy Zam贸wienia,</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.K</span><span lang=\"pl\" xml:lang=\"pl\">likn przycisk Zamawiam i pac</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.W</span><span lang=\"pl\" xml:lang=\"pl\">ybra spos贸b patnoci i opaci zam贸wienie.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 8</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Oferowane metody dostawy oraz patnoci<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Klient mo偶e skorzysta z nastpujcych metod dostawy lub odbioru zam贸wionego Produktu:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.</span><span lang=\"pl\" xml:lang=\"pl\">Przesykawirutalna na adres e-mailowy Klienta<br /><br /></span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Klient mo偶e skorzysta z nastpujcych metod patnoci:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.</span><span lang=\"pl\" xml:lang=\"pl\">Patno przelewem na konto Sprzedawcy</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.</span><span lang=\"pl\" xml:lang=\"pl\">Patnoci elektroniczne</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.</span><span lang=\"pl\" xml:lang=\"pl\">Patno kart patnicz.<br /><br /></span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. Szczeg贸owe informacje na temat metod dostawy oraz akceptowalnych metod patnoci znajduj si za stronach Sklepu.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 9</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Wykonanie umowy sprzeda偶y<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Zawarcie Umowy Sprzeda偶y midzy Klientem a Sprzedawc nastpuje po uprzednim zo偶eniu przez Klienta Zam贸wienia za pomoc Formularza zam贸wienia w Sklepie internetowym zgodnie z 搂 7 Regulaminu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Po zo偶eniu Zam贸wienia Sprzedawca niezwocznie potwierdza jego otrzymanie oraz jednoczenie przyjmuje Zam贸wienie do realizacji. Potwierdzenie otrzymania Zam贸wienia i jego przyjcie do realizacji nastpuje poprzez przesanie przez Sprzedawc Klientowi stosownej wiadomoci e-mail na podany w trakcie skadania Zam贸wienia adres poczty elektronicznej Klienta, kt贸ra zawiera co najmniej owiadczenia Sprzedawcy o otrzymaniu Zam贸wienia i o jego przyjciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzeda偶y. Z chwil otrzymania przez Klienta powy偶szej wiadomoci e-mail zostaje zawarta Umowa Sprzeda偶y midzy Klientem a Sprzedawc.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.</span><span lang=\"pl\" xml:lang=\"pl\">W przypadku zam贸wienia Produkt贸w o r贸偶nych terminach dostawy, terminem dostawy jest najdu偶szy podany termin.</span></p>\n<p>W przypadku zam贸wienia Produkt贸w o r贸偶nych terminach dostawy, Klient ma mo偶liwo 偶dania dostarczenia Produkt贸w czciami lub te偶 dostarczenia wszystkich Produkt贸w po skompletowaniu caego zam贸wienia.</p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><span lang=\"pl\" xml:lang=\"pl\">Pocztek biegu terminu dostawy Produktu do Klienta liczy siod dnia zaksigowania patnoci za zakup na rachunku bankowymSprzedawcy.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">5. W przypadku wyboru przez Klienta odbioru osobistego Produktu, Produkt bdzie gotowy do odbioru przez Klienta wdniu nastpnym roboczym po otrzymaniu patnoci przez Sprzedawc. O gotowoci Produktu do odbioru Klient zostanie dodatkowo poinformowany przez Sprzedawc poprzez przesanie stosownej wiadomoci e-mail na podany w trakcie skadania Zam贸wienia adres poczty elektronicznej Klienta.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">6. W przypadku zam贸wienia Produkt贸w o r贸偶nych terminach gotowoci do odbioru, Klient ma mo偶liwo odbierania Produkt贸w czciami (stosownie do ich gotowoci do odbioru) lub te偶 odbioru wszystkich Produkt贸w po skompletowaniu caego zam贸wienia.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">7. Dostawa Produktu odbywa si wycznie na terenie Polski.<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 10Rozwizanie umowy</span></b><b><span lang=\"pl\" xml:lang=\"pl\"><br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.  </span>Zam贸wienie usug internetowych (elektronicznych) przez Konsumenta lub Przedsibiorc wi偶e si z utrat prawa do odstpienia od niniejszej umowy i braku zwrotu wpaconych opat za usugi.<br /><br />2. Usugodawcy przysuguje prawo rozwizania Umowy ze skutkiem natychmiastowym w nastpujcych przypadkach:</p>\n<p class=\"Normalny1CxSpMiddle\">a. podanie przez Klienta faszywych danych w trakcie rejestracji,</p>\n<p class=\"Normalny1CxSpMiddle\">b. niepowiadomienie Usugodawcy o zmianie danych rejestrowych Klienta w terminie 30 dni od dokonania zmiany,</p>\n<p class=\"Normalny1CxSpMiddle\">c. nieuiszczenie przez Klienta opat za Usug,</p>\n<p class=\"Normalny1CxSpMiddle\">d. prowadzenie za porednictwem Sklepu internetowego sprzeda偶y towar贸w lub usug zabronionych przez prawo lub pochodzcych z przestpstw.</p>\n<p class=\"Normalny1CxSpMiddle\">e. ra偶cego naruszenia innych postanowie niniejszego Regulaminu.</p>\n<p class=\"Normalny1CxSpMiddle\">f. dziaanie na szkod Usugodawcy oraz werbalne lub pisemne nadu偶ycie w stosunku do Usugodawcy mo偶e skutkowa wypowiedzeniem umowy w trybie natychmiastowym. W powy偶szych przypadkach Klientowi nie przysuguje zwrot wpaconej nale偶noci za ju偶 wykorzystany okres abonamentowy</p>\n<p class=\"Normalny1CxSpMiddle\"></p>\n<!-- \n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Bieg terminu okrelonego w ust. 1 rozpoczyna si od dostarczenia Produktu Konsumentowi lub wskazanej przez niego osobie innej ni偶 przewo藕nik.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.</span><span lang=\"pl\" xml:lang=\"pl\">W przypadku Umowy, kt贸ra obejmuje wiele Produkt贸w, kt贸re s dostarczane osobno, partiami lub w czciach, termin wskazany w ust. 1 biegnie od dostawy ostatniej rzeczy, partii lub czci.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><span lang=\"pl\" xml:lang=\"pl\">W przypadku Umowy, kt贸ra polega na regularnym dostarczaniu Produkt贸w przez czas oznaczony (prenumerata), t