\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.</span><span lang=\"pl\" xml:lang=\"pl\">Reklamacj nale偶y zgosi pisemnie lub drog elektroniczn na podane w niniejszym Regulaminie adresy Sprzedawcy.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.</span><span lang=\"pl\" xml:lang=\"pl\">Zaleca si, aby w reklamacji zawrze m.in. zwizy opis wady, okolicznoci (w tym dat) jej wystpienia, dane Klienta skadajcego reklamacj, oraz 偶danie Klienta w zwizku z wad towaru.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">6. Sprzedawca ustosunkuje si do 偶dania reklamacyjnego niezwocznie i wyznaczy termin naprawy usugi nie p贸藕niej ni偶 30 dni od zgoszenia<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 12</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Pozasdowe sposoby rozpatrywania reklamacji i dochodzenia roszcze<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Szczeg贸owe informacje dotyczce mo偶liwoci skorzystania przez Konsumenta z pozasdowych sposob贸w rozpatrywania reklamacji i dochodzenia roszcze oraz zasady dostpu do tych procedur dostpne s w siedzibach oraz na stronach internetowych powiatowych (miejskich) rzecznik贸w konsument贸w, organizacji spoecznych, do kt贸rych zada statutowych nale偶y ochrona konsument贸w, Wojew贸dzkich Inspektorat贸w Inspekcji Handlowej oraz pod nastpujcymi adresami internetowymi Urzdu Ochrony Konkurencji i Konsument贸w: http://www.uokik.gov.pl/spory_konsumenckie.php; http://www.uokik.gov.pl/sprawy_indywidualne.php oraz http://www.uokik.gov.pl/wazne_adresy.php.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Konsument posiada nastpujce przykadowe mo偶liwoci skorzystania z pozasdowych sposob贸w rozpatrywania reklamacji i dochodzenia roszcze:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.</span><span lang=\"pl\" xml:lang=\"pl\">Konsument uprawniony jest do zwr贸cenia si do staego polubownego sdu konsumenckiego, o kt贸rym mowa w art. 37 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. z 2014 r. poz. 148 z p贸藕n. zm.), z wnioskiem o rozstrzygnicie sporu wynikego z Umowy zawartej ze Sprzedawc.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.</span><span lang=\"pl\" xml:lang=\"pl\">Konsument uprawniony jest do zwr贸cenia si do wojew贸dzkiego inspektora Inspekcji Handlowej, zgodnie z art. 36 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. z 2014 r. poz. 148 z p贸藕n. zm.), z wnioskiem o wszczcie postpowania mediacyjnego w sprawie polubownego zakoczenia sporu midzy Konsumentem a Sprzedawc.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.</span><span lang=\"pl\" xml:lang=\"pl\">Konsument mo偶e uzyska bezpatn pomoc w sprawie rozstrzygnicia sporu midzy nim a Sprzedawc, korzystajc tak偶e z bezpatnej pomocy powiatowego (miejskiego) rzecznika konsument贸w lub organizacji spoecznej, do kt贸rej zada statutowych nale偶y ochrona konsument贸w (m.in. Federacja Konsument贸w, Stowarzyszenie Konsument贸w Polskich).<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 13</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Dane osobowe w Sklepie internetowym<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.</span><span lang=\"pl\" xml:lang=\"pl\">Administratorem danych osobowych Klient贸w zbieranych i przetwarzanych za porednictwem Sklepu internetowego jest Sprzedawca.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.</span><span lang=\"pl\" xml:lang=\"pl\">Dane osobowe Klient贸w zbierane i przetwarzane przez administratora za porednictwem Sklepu internetowego zbierane s w celu realizacji Umowy Sprzeda偶y.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. Podanie danych osobowych jest dobrowolne, aczkolwiek niepodanie wskazanych w Regulaminie danych osobowych niezbdnych do zawarcia Umowy Sprzeda偶y skutkuje brakiem mo偶liwoci zawarcia tej偶e umowy.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">4. Pena informacja nt cel贸w przetwarzania oraz praw Klienta dostpna jest w zakadce \"RODO\" -<a href=\"/info/12-rodo\" target=\"_blank\" rel=\"noreferrer noopener\">Informacja nt przetwarzania danych osobowych</a></span></p>\n<p class=\"Normalny1\"><br /><br /><br /></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">搂 14</span></b><b><span lang=\"pl\" xml:lang=\"pl\">Postanowienia kocowe<br /><br /></span></b></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">1. Umowy zawierane poprzez Sklep internetowy zawierane s w jzyku polskim.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">2. Sprzedawca zastrzega sobie prawo do dokonywania zmian Regulaminu z wa偶nych przyczyn to jest: zmiany przepis贸w prawa, zmiany sposob贸w patnoci i dostaw - w zakresie, w jakim te zmiany wpywaj na realizacj postanowie niniejszego Regulaminu. O ka偶dej zmianie Sprzedawca poinformuje Klienta z co najmniej 7 dniowym wyprzedzeniem.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. W sprawach nieuregulowanych w niniejszym Regulaminie maj zastosowanie powszechnie obowizujce przepisy prawa polskiego, w szczeg贸lnoci: Kodeksu cywilnego; ustawy o wiadczeniu usug drog elektroniczn; ustawy o prawach konsumenta, ustawy o ochronie danych osobowych.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">4. Klient ma prawo skorzysta z pozasdowych sposob贸w rozpatrywania reklamacji i dochodzenia roszcze. W tym celu mo偶e zo偶y skarg za porednictwem unijnej platformy internetowej ODR dostpnej pod adresem:<a href=\"http://ec.europa.eu/consumers/odr/\">http://ec.europa.eu/consumers/odr/</a>.</span></p>\n<p align=\"center\"></p>\n<p align=\"center\"></p>\n</div>\n</div>\n<!-- #center_column --></div>', 'regulamin'),
