adres e-mail podany w punkcie 2, takiego 偶danie. Zrobimy to, chyba 偶e bdzie istniaa inna podstawa prawna, </span><span style=\"color:#222222;\"><span style=\"font-size:medium;\"><span>wynikajca z prawa finansowego lub kodeksu cywilnego, kt贸ra bdzie nakadaa na nas obowizek dalszego przetwarzania Twoich danych.</span></span></span><span style=\"font-size:medium;\"> </span></p>\n</li>\n</ol>\n<p></p>\n<p></p>\n<p><span style=\"font-size:medium;\">- Jeli robie zakupy przez nasz sklep internetowy, lub za pomoc platformy sprzeda偶y internetowej jestemy zobowizani przetwarza Twoje dane przez okres 3 lat, od koca roku kalendarzowego w kt贸rym zrobie u nas ostatnie zakupy (podstawa prawna: art. 118 KC)</span></p>\n<p><span style=\"font-size:medium;\">- Jeli robie zakupy towaru w naszym stacjonarnym punkcie handlowym i na Twoje 偶yczenie wystawilimy Ci imienny paragon lub faktur sprzeda偶y jestemy zobowizani przetwarza Twoje dane przez okres 2 lat, od koca roku kalendarzowego w kt贸rym zrobie ostatnie zakupy (podstawa prawna: art. 554 KC)</span></p>\n<p><span style=\"font-size:medium;\">- Jeli wykonywalimy dla Ciebie usug (na podstawie umowy o wykonanie usugi), jestemy zobowizani do przetwarzania Twoich danych przez 10 lat, od koca roku kalendarzowego, w kt贸rym usuga zostaa wykonana (podstawa prawna: art. 118 KC)</span></p>\n<p><span style=\"font-size:medium;\">- Po tym jak za偶dasz od nas usunicia Twoich danych, mo偶emy nadal je przetwarza, tylko w podanych poni偶ej celach, na podstawie prawnie uzasadnionych interes贸w ...............</span></p>\n<ol>\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">windykacja nale偶noci</span></span></p>\n</li>\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">prowadzenie postpowa sdowych, arbitra偶owych i mediacyjnych</span></span></p>\n</li>\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">przechowywanie danych dla cel贸w archiwizacyjnych oraz zapewnienie rozliczalnoci (wykazania spenienia przez nas obowizk贸w wynikajcych z przepis贸w prawa)</span></span></p>\n</li>\n</ol>\n<p><span style=\"color:#222222;\"> <br /><span style=\"font-size:medium;\">Po wyganiciu tych cel贸w, Twoje dane zostan automatycznie usunite.</span></span></p>\n<ol start=\"6\">\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">Masz tak偶e prawo do ograniczenia przetwarzania danych do ich przechowywania, przesyajc nam takie 偶danie na adres e-mail podany w punkcie 2</span></span><span style=\"font-size:medium;\">. Po otrzymaniu takiego 偶dania, ograniczymy przetwarzanie Twoich danych tylko do ich przechowywania, przestaniemy wtedy wykonywa inne czynnoci skadajce si na przetwarzanie.</span></p>\n</li>\n</ol>\n<p></p>\n<ol start=\"7\">\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">Masz tak偶e prawo do odwoania wyra偶onej wczeniej zgody na przetwarzanie danych osobowych (poinformuj nas o swojej decyzji wiadomoci na adres e-mail wskazany w punkcie 2). Skorzystanie z prawa cofnicia zgody nie ma wpywu na przetwarzanie, kt贸re miao miejsce do momentu wycofania zgody.</span></span></p>\n</li>\n</ol><ol start=\"8\">\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">Masz tak偶e prawo do przenoszenia danych. Na Twoje 偶danie (</span></span><span style=\"font-size:medium;\">przesane na adres e-mail w punkcie 2</span><span style=\"color:#222222;\"><span style=\"font-size:medium;\">), w cigu miesica przygotujemy i wylemy Ci plik w formacie</span></span><span style=\"color:#ff0000;\"><span style=\"font-size:medium;\"> </span></span><span style=\"font-size:medium;\">.csv.</span></p>\n</li>\n</ol>\n<p></p>\n<p><span style=\"font-size:medium;\">- W ramach prawa do przenoszenia danych, mo偶esz wskaza nam podmiot do kt贸rego mamy dane przesa. Poniewa偶 mamy obowizek dbania o bezpieczestwo Twoich danych, zanim za偶dasz przeniesienia swoich danych, upewnij si do kogo trafi</span></p>\n<p></p>\n<p><span style=\"font-size:medium;\">- Kiedy przylesz do nas 偶danie przekazania danych, ze wzgld贸w bezpieczestwa, zostaniesz poddany weryfikacji. Gdy przejdziesz j pozytywnie, przelemy Ci kopi Twoich danych zachowujc adekwatne rodki bezpieczestwa.</span></p>\n<p></p>\n<ol start=\"9\">\n<li>\n<p><span style=\"font-size:medium;\">Twoje dane osobowe kt贸re przetwarzamy to:</span></p>\n</li>\n</ol>\n<ul>\n<li><span style=\"font-size:medium;\">Twoje imi i nazwiska</span></li>\n<li><span style=\"font-size:medium;\">opcjonalnie nazw firmy w kt贸rej pracujesz </span></li>\n<li><span style=\"font-size:medium;\">Tw贸j adres (lub adres Twojego miejsca pracy, lub ka偶dy inny adres kt贸ry wska偶esz jako adres dostawy zam贸wionych przez Ciebie towar贸w lub wykonania usugi)</span></li>\n<li><span style=\"font-size:medium;\">Tw贸j adres e-mail</span></li>\n<li><span style=\"font-size:medium;\">opcjonalnie Tw贸j nr telefonu</span></li>\n</ul>\n<ol start=\"10\">\n<li>\n<p><span style=\"font-size:medium;\">Je偶eli dane kt贸re nam podasz nale偶 do innej osoby (Ty zamawiasz i pacisz, lub tylko zamawiasz wskazujc jako odbiorc inna osob) pamitaj, 偶e mamy obowizek poinformowa t osob o przekazaniu nam przez Ciebie jej danych, oraz wszystkich informacji, kt贸re przekazujemy teraz Tobie, i 偶e mo偶emy zrealizowa umow sprzeda偶y towaru lub usugi dopiero gdy uzyskamy zgod tej osoby na przetwarzanie przez nas jej danych.</span></p>\n</li>\n</ol>\n<p></p>\n<ol start=\"11\">\n<li>\n<p><span style=\"font-size:medium;\">Przetwarzanie Twoich danych osobowych ma r贸偶ne cele. Poni偶ej ich lista:</span></p>\n</li>\n</ol>\n<ul style=\"list-style-type:disc;\">\n<li><span style=\"font-size:medium;\">Twoje imi, nazwisko, adres, adres e-mail (i opcjonalnie nazw firmy w kt贸rej pracujesz) przetwarzamy aby zrealizowa umow sprzeda偶y lub umow na wykonanie usugi</span></li>\n<li><span style=\"font-size:medium;\">Twoje imi, nazwisko i adres e-mail (i opcjonalnie nr telefonu) przetwarzamy aby przedstawi Ci ofert handlow na nasze usugi i towary  ofert przedstawimy Ci tylko na Twoje wyra藕ne 偶yczenie, okrelajce kt贸rych towar贸w i usug oferta ma dotyczy.</span></li>\n<li><span style=\"font-size:medium;\">Tw贸j adres e-mail (i opcjonalnie nr telefonu) przetwarzamy dodatkowo aby poinformowa Ci o stanie realizacji Twojego zam贸wienia, przekazania Ci informacji o sposobie dostawy czy innych informacji dotyczcych sposobu realizacji zam贸wienia towar贸w lub usug.</span></li>\n</ul>\n<ol start=\"12\">\n<li>\n<p><span style=\"font-size:medium;\">Konieczne mo偶e by przekazanie Twoich danych (na podstawie umowy o powierzeniu danych osobowych do przetwarzania) firmom wspierajcym nasz firm w celu realizacji Twojego zam贸wienia  firmie kurierskiej, firmie poredniczcej w patnociach internetowych, platformie sprzeda偶y internetowej.</span></p>\n</li>\n</ol>\n<p><span style=\"font-size:medium;\">Twoje dane powierzamy do przetwarzania tylko firmom, kt贸re zapewniaj wystarczajce gwarancje ich bezpieczestwa.</span></p>\n<ol start=\"13\">\n<li>\n<p><span style=\"font-size:medium;\">W naszej firmie do Twoich danych maj dostp jedynie pracownicy odpowiedzialni za realizacj Twojego zam贸wienia. Ka偶dy z nich jest zobowizany do zachowania w tajemnicy Twoich danych i przetwarzania tylko tych danych, kt贸re s mu niezbdne dla realizacji Twojego zam贸wienia.</span></p>\n</li>\n</ol>\n<p></p>\n<ol start=\"14\">\n<li>\n<p><span style=\"font-size:medium;\">Informujemy, 偶e nie przetwarzamy Twoich danych w celu profilowania czy celach marketingowych (np. przesyanie Ci newslettera, niechcianych ofert, reklam).</span></p>\n</li>\n</ol>\n<h2>Cookies</h2>\n<p>Pliki cookies (tzw. ciasteczka) to niewielkie pliki tekstowe wysyane przez odwiedzany serwis internetowy do urzdzenia internauty (komputer, smartfon itp.). Nie zawieraj one 偶adnych danych osobowych.</p>\n<p>Nasz Serwis stosujenastpujcecookies:</p>\n<p>1. wydajnociowe (zbierajce informacje na temat sposobu u偶ywania witryny przez odwiedzajcych, np. najczciej odwiedzanych stron lub komunikat贸w o bdach itp.),<br /> 2. funkcjonalne (zapisujce ustawienia u偶ytkownika, np. jzyk, wyra偶one zgody itp.)</p>\n<ul>\n<li>cookies google-analytics.com  su偶 do prowadzenia statystyk dla witryny gov.pl; dokadny spos贸b dziaania i polityk prywatnoci Google Analytics mo偶na znale藕 pod adresem: https://marketingplatform.google.com/about/analytics/terms/pl/, https://policies.google.com/privacy</li>\n<li>cookies .facebook.com  su偶 do obsugi skrypt贸w z serwisu facebook.com takich jak polubienia, udostpnianie post贸w czy logowania</li>\n<li>cookies .google.com  obsuga np. logowania poprzez Google+/Gmail, reklam Google Ads czy funkcji analitycznych ruchu na stronie</li>\n<li>cookies sesyjne  s to tymczasowe informacje przechowywane w pamici przegldarki do momentu zakoczenia sesji, czyli jej zamknicia.</li>\n</ul>\n<p><br /><strong style=\"margin:0px;padding:0px;font-size:16px;line-height:inherit;font-family:\'Open Sans\', sans-serif;vertical-align:baseline;color:#1b1b1b;background-color:#ffffff;\">W wikszoci przegldarek internetowych mo偶na: kasowa pliki typu cookies z twardego dysku komputera (z poziomu ustawie przegldarki), zablokowa wszystkie przysyane pliki typu cookies lub ustawi ostrze偶enie przed zapisaniem ich na dysku.</strong><br /><br />Nale偶y mie na uwadze, 偶e zmiany ustawie tych plik贸w polegajce na ograniczeniu ich stosowania mog wpyn na niekt贸re funkcjonalnoci dostpne na stronach internetowych je stosujcych np. uniemo偶liwiajc zalogowanie si na konto pocztowe. Brak zmiany tych ustawie oznacza akceptacj dla stosowania plik贸w typu cookies.</p>\n<h2>Jak wyczy ciasteczka?</h2>\n<ul>\n<li><a target=\"_blank\" href=\"http://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plik贸w cookie w Chrome</a></li>\n<li><a target=\"_blank\" href=\"http://support.mozilla.org/pl/kb/W%C5%82%C4%85czanie%20i%20wy%C5%82%C4%85czanie%20obs%C5%82ugi%20ciasteczek\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plik贸w cookie w Firefoxie</a></li>\n<li>