(19, 1, 1, 'Produkt - dlaczego warto', '', '', '', '<p><img src=\"https://localhost/fshop/img/cms/bestglass.png\" alt=\"\" width=\"1120\" height=\"124\" /></p>\r\n<p style=\"text-align:justify;\">Zapraszamy do naszego sklepu internetowego, gdzie znajdziesz produkty najwy偶szej jakoci od polskiego producenta. Wspierajc lokalne przedsibiorstwa, wybierasz produkty tworzone z pasj i dbaoci o ka偶dy detal. Nasze wyroby charakteryzuj si nie tylko wyjtkowym designem, ale tak偶e trwaoci i funkcjonalnoci. Kupujc u nas, masz pewno, 偶e wybierasz produkty, kt贸re powstaj z poszanowaniem tradycji i najnowszych technologii. Docz do grona zadowolonych klient贸w i ciesz si zakupami wspierajcymi polsk gospodark!</p>', 'produkt-dlaczego-warto'),
