(21, 1, 1, 'Nowy produkt w ofercie', 'Lataj wy偶ej i dalej z najnowszym modelem drona!', '', '23-05-2023', '<div class=\"custom--blog\">\r\n<p><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\"><img src=\"https://localhost/fshop/img/cms/drone2.jpg\" alt=\"dron\" width=\"1080\" height=\"800\" /></span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">Jestemy dumni, 偶e mo偶emy zaprezentowa nasz flagowy produkt  nowoczesny dron, kt贸ry definiuje nowe standardy w bran偶y technologicznej. Wyposa偶ony w zaawansowane funkcje takie jak automatyczne ledzenie, stabilizacja obrazu oraz dugi czas lotu, nasz dron jest idealnym wyborem dla entuzjast贸w technologii i profesjonalnych filmowc贸w. </span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">Dziki intuicyjnemu interfejsowi u偶ytkownika i niezr贸wnanej jakoci wykonania, nasz dron jest przygotowany, aby towarzyszy Ci w ka偶dej przygodzie.</span></p>\r\n</div>', 'nowy-produkt-w-ofercie'),
(22, 1, 1, 'Promocje tygodnia', 'Oszczdzaj wicej z naszymi ekskluzywnymi ofertami!', 'Promocje tygodnia', '19-05-2024', '<div class=\"custom--blog\">\r\n<p><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\"><img src=\"https://localhost/fshop/img/cms/piggy.jpg\" alt=\"skarbonka\" width=\"654\" height=\"403\" /></span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">Zachcamy do regularnego odwiedzania naszej strony, gdzie co tydzie prezentujemy nowe promocje, kt贸re pozwol Ci znacznie obni偶y koszty zakup贸w. Od elektroniki po artykuy gospodarstwa domowego, nasze obni偶ki obejmuj szeroki zakres produkt贸w. </span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">To wietna okazja, by zaktualizowa swoje urzdzenia lub wzbogaci dom o nowe gad偶ety bez nadwyr偶ania portfela. Ka偶da promocja jest starannie dobierana, aby dostarcza naszym klientom najlepszej wartoci.</span></p>\r\n<div></div>\r\n</div>', 'promocje-tygodnia'),
(23, 1, 1, 'Zapraszamy do kontaktu', 'Zapraszamy do kontaktu', 'Masz pytania? Nasz zesp贸 obsugi klienta chtnie na nie odpowie.', '15-05-2024', '<div class=\"custom--blog\"><span style=\"color:#0d0d0d;font-family:\'S枚hne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\"><img src=\"https://localhost/fshop/img/cms/39012111_l_normal_none.jpg\" alt=\"kontakt\" width=\"1707\" height=\"2561\" /></span></div>\r\n<div class=\"custom--blog\">\r\n<p class=\"MsoNormal\">Nasza dedykowana obsuga klienta jest zawsze gotowa, by odpowiedzie na Twoje pytania i rozwia wszelkie wtpliwoci.</p><p></p>\r\n<p class=\"MsoNormal\">Niezale偶nie od tego, czy szukasz porady dotyczcej wyboru produkt贸w, czy potrzebujesz wsparcia technicznego, nasi eksperci s tutaj, aby zapewni Ci szybk i rzeteln pomoc. Staramy si, aby ka偶da interakcja z naszym sklepem bya pozytywnym dowiadczeniem, kt贸re przyczynia si do budowania dugotrwaych relacji z naszymi klientami.</p><p></p>\r\n<p class=\"MsoNormal\">Kontakt i godziny otwarcia: Nasz zesp贸 obsugi klienta jest do Twojej dyspozycji 7 dni w tygodniu, od 8:00 do 20:00. Skontaktuj si z nami przez email:kontakt@naszsklep.pllub telefon: 123 456 789.</p><p></p>\r\n</div>', 'zapraszamy-do-kontaktu');
