(219, 1, 1, '', '<p>Wygodne i stylowe jeansowe szorty z przetarciami, kt贸re dodadz Twojej garderobie modzieczego i modnego charakteru. Wykonane z wysokiej jakoci denimu, zapewniajcego trwao i komfort noszenia przez cay dzie. Szorty maj klasyczny, nieco dopasowany kr贸j, kt贸ry podkrela sylwetk, a jednoczenie pozwala na swobod ruch贸w.</p>\r\n<p>Charakterystyczne przetarcia i dziury na nogawkach nadaj im odwa偶nego, nieco buntowniczego wygldu, idealnego na letnie festiwale, spontaniczne wyjcia z przyjaci贸mi czy codzienne aktywnoci. Dodatkowo, szorty wyposa偶one s w pi funkcjonalnych kieszeni  dwie z przodu, dwie z tyu oraz jedn ma, co czyni je praktycznym wyborem na co dzie.</p>\r\n<p>Zapinane na zamek byskawiczny i guzik, atwo dopasowuj si do sylwetki, a szlufki na pasek pozwalaj na dodatkowe stylizacyjne eksperymenty. Ich uniwersalny niebieski kolor sprawia, 偶e doskonale komponuj si zar贸wno z t-shirtami, jak i eleganckimi bluzkami, dajc nieograniczone mo偶liwoci tworzenia r贸偶nych letnich stylizacji.</p>\r\n<p>Jeansowe szorty z przetarciami to must-have na ciepe dni, kiedy chcesz czu si modnie i komfortowo.<br /><br />Dostpne w wielu kolorach i rozmiarach.</p>', 'spodenki-krotkie-wiosnalato', '', '', '', 'Spodenki kr贸tkie wiosna/lato', '', '', '', '', NULL),
(220, 1, 1, '', '<p>Odkryj sk贸rzan torebk \"Timeless Style\" w przygaszonym odcieniu jasnego brzu, idealn dla kobiet, kt贸re ceni klasyczny wygld i funkcjonalno. Ta elegancka torebka o rozmiarze A4 zostaa wykonana z najwy偶szej jakoci sk贸ry naturalnej, oferujc poczenie stylu i praktycznoci.</p>\r\n<ul>\r\n<li><span>Materia:</span> Sk贸ra naturalna</li>\r\n<li><span>Wymiary:</span> 30 cm (wysoko) x 35 cm (szeroko) x 10 cm (gboko)</li>\r\n<li><span>Kolor:</span> Przygaszony jasnobrzowy</li>\r\n<li><span>Zapicie:</span> Zamek byskawiczny</li>\r\n<li><span>Wntrze:</span> Przestronna g贸wna komora mieszczca dokumenty w formacie A4, dodatkowa kieszonka na telefon i klucze</li>\r\n<li><span>Rczka:</span> Regulowana, umo偶liwiajca noszenie torebki na ramieniu lub w rce</li>\r\n</ul>\r\n<p>Jasnobrzowa torebka \"Timeless Style\" to doskonay wyb贸r na ka偶dy dzie oraz do pracy. Dziki swojemu klasycznemu wygldowi i praktycznym rozmiarom, jest idealna do noszenia dokument贸w, laptopa i innych niezbdnych rzeczy, jednoczenie dodajc szyku ka偶dej stylizacji.<br /><br />Dostpna r贸wnie偶 w innych kolorach.</p>', 'skorzana-torebka-timeless-style', '', '', '', 'Sk贸rzana Torebka \"Timeless Style\"', '', '', '', '', NULL),
(222, 1, 1, '', '<p>Wyr贸偶nij sw贸j styl elegancj i ponadczasowym wdzikiem dziki naszemu klasycznemu zegarkowi mskiemu. Ten wyrafinowany czasomierz to poczenie precyzji, funkcjonalnoci i niezawodnoci, kt贸rej mo偶esz zaufa w ka偶dej sytuacji. Zegarek ten prezentuje si nie tylko wyjtkowo stylowo, ale tak偶e charakteryzuje si solidn konstrukcj, kt贸ra zapewnia trwao i niezawodno przez wiele lat.</p>\r\n<h3>Cechy zegarka:</h3>\r\n<ol>\r\n<li>\r\n<p><span>Klasyczny design:</span> Zegarek posiada klasyczny design, kt贸ry nigdy nie wychodzi z mody. Zegarek ten jest ponadczasowy i doskonale pasuje do r贸偶nych stylizacji, od formalnych po casualowe.</p>\r\n</li>\r\n<li>\r\n<p><span>Solidna koperta:</span> Koperta zegarka wykonana jest z wysokiej jakoci stali nierdzewnej lub innego trwaego materiau, kt贸ry zapewnia ochron mechanizmu zegara oraz wytrzymao na codzienne u偶ytkowanie.</p>\r\n</li>\r\n<li>\r\n<p><span>Clear dial:</span> Zegarek posiada czytelny i przejrzysty cyferblat z wyra藕nymi wska藕nikami godzin, minut i sekund oraz datownikiem. To sprawia, 偶e czas odczytuje si atwo i szybko nawet w szybkim ruchu.</p>\r\n</li>\r\n<li>\r\n<p><span>Mechanizm kwarcowy lub automatyczny:</span> Zegarek wyposa偶ony jest w precyzyjny mechanizm kwarcowy lub automatyczny, kt贸ry zapewnia dokadno wskaza czasu oraz niezawodn prac.</p>\r\n</li>\r\n<li>\r\n<p><span>Paski do wyboru:</span> Zegarek mo偶e by wyposa偶ony w pasek ze sk贸ry naturalnej, stalowy pasek jubilerski lub pasek z innego materiau, co pozwala dopasowa zegarek do indywidualnych preferencji i stylu.</p>\r\n</li>\r\n</ol>\r\n<h3>Zalety zegarka:</h3>\r\n<ul>\r\n<li><span>Elegancja i styl:</span> Klasyczny design zegarka dodaje elegancji i szyku do ka偶dej stylizacji, podkrelajc indywidualny charakter noszcego.</li>\r\n<li><span>Trwao:</span> Solidna konstrukcja i wysokiej jakoci materiay zapewniaj trwao i niezawodno zegarka przez wiele lat u偶ytkowania.</li>\r\n<li><span>Funkcjonalno:</span> Zegarek nie tylko informuje o czasie, ale tak偶e mo偶e